import React, { useEffect, useState } from 'react';

const Home = () => {

    const [parts, setParts] = useState({});

    useEffect(() => {
        getParts()
    }, [])

    useEffect(() => {
        console.log(
            'parts ', parts
        )
    },[parts])

    const getParts = async () => {
        try {
            const response2 = await fetch('GetRelatedParts');
            const data = await response2.json()
            setParts(data)
        }
        catch (error) {
            console.error("error ", error)
        }
    }

    return (
        <div>
            <h1>Hello, I am a functional component!</h1>
            <p>This is a simple example of a functional component in React.</p>
        </div>
    );
};

export default Home;
